-- ----------------------------
-- Table structure for c_charging_order
-- ----------------------------
DROP TABLE IF EXISTS `c_charging_order`;
CREATE TABLE `c_charging_order`  (
  `order_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '订单id',
  `user_id` bigint(0) NULL DEFAULT NULL COMMENT '用户id',
  `order_state` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '订单状态 1.下单 2.取消 3.支付成功 4.退款 5.完成 6.结算中 7.手动结算',
  `pile_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电桩ID',
  `port_id` bigint(0) NULL DEFAULT NULL COMMENT '充电口ID',
  `start_time` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '结束时间',
  `order_number` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '订单号',
  `charge_status` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '9001' COMMENT '充电状态 9001 未开始 9002 充电中 9003 已完成',
  `is_fee` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '2001' COMMENT '是否收费,2001 收费（默认），2002不收费  取决于充电桩',
  `consume_power` decimal(18, 6) NULL DEFAULT NULL COMMENT '耗电量 单位 kw',
  `charging_current` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电电流',
  `charging_cdgl` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电功率',
  `custom_price_id` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '自定义价格ID',
  `hour` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电时长，用户选择充电时间',
  `price` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '发布金额',
  `mobile` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '手机号',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '订单创建时间',
  `code` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `card_no` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '卡号(卡支付时插入)',
  `ordergold` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '支付金额',
  `order_type` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '8001' COMMENT '订单类型，8001 按小时计费（取决于用户选择,默认） 8002 按度数计费（取决于 用户选择）',
  `out_trade_no` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT 'wx支付订单编写',
  `real_hour` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '实际充电时长',
  `real_end_time` datetime(0) NULL DEFAULT NULL COMMENT '实际充电结束时间',
  `refund_amount` decimal(18, 6) NULL DEFAULT 0.000000 COMMENT '退款金额',
  `device_type` int(0) NOT NULL DEFAULT 2 COMMENT '设备类型 2:二轮车 4:四轮车',
  `charge_fee` decimal(12, 4) NULL DEFAULT NULL COMMENT '充电费用',
  `service_fee` decimal(12, 4) NULL DEFAULT 0.0000 COMMENT '服务费',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  `order_source` int(0) NULL DEFAULT 2 COMMENT '订单来源，微信小程序：1，H5：2  卡：3',
  `is_group_order` int(0) NULL DEFAULT NULL COMMENT '0不是1是',
  `group_card_no` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '卡号',
  `invoice_id` int(0) NULL DEFAULT NULL COMMENT '发票主键',
  `invoice_no` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '发票号',
  `stop_reason` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '停止原因',
  `tenant_id` bigint(0) NULL DEFAULT NULL COMMENT '租户编号',
  `create_by` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`order_id`) USING BTREE,
  UNIQUE INDEX `idx_ordernumber`(`order_number`) USING BTREE,
  INDEX `idx_parklockid`(`port_id`) USING BTREE,
  INDEX `idx_weixin_openid`(`user_id`) USING BTREE,
  INDEX `idx_parkid`(`pile_id`) USING BTREE,
  INDEX `idx_createtime`(`create_time`) USING BTREE,
  INDEX `idx_cardno`(`card_no`) USING BTREE,
  INDEX `idx_createTime_orderstate`(`order_state`, `create_time`) USING BTREE,
  INDEX `idx_orderstate_createtime_refundamount`(`order_state`, `create_time`, `refund_amount`) USING BTREE,
  INDEX `idx_orderstate_createtime_ordergold`(`order_state`, `create_time`, `ordergold`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '充电订单表' ROW_FORMAT = Dynamic;

