-- Records of c_charging_order
-- ----------------------------

-- ----------------------------
-- Table structure for c_charging_pile
-- ----------------------------
DROP TABLE IF EXISTS `c_charging_pile`;
CREATE TABLE `c_charging_pile`  (
  `pile_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '编号',
  `name` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '名称',
  `cp_fee_type` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '2001' COMMENT '默认 2001 充电桩收费类型，2001：收费 2002：免费',
  `sim_card` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT 'sim卡序列号',
  `sim_due_time` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT 'sim卡到期时间',
  `equip_temperature` decimal(18, 6) NULL DEFAULT NULL COMMENT '设备温度',
  `equip_cpu_temperature` decimal(18, 6) NULL DEFAULT NULL COMMENT '设备cpu温度',
  `lat` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '经度',
  `lng` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '纬度',
  `address` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '地址',
  `img_url` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '图片地址',
  `running_status` int(0) NULL DEFAULT 1 COMMENT '运行状态，0 运行 1 离线',
  `offline_time` datetime(0) NULL DEFAULT NULL COMMENT '离线时间',
  `user_id` bigint(0) NULL DEFAULT NULL COMMENT '代理商ID',
  `last_use_time` datetime(0) NULL DEFAULT NULL COMMENT '最后一次使用时间',
  `station_id` bigint(0) NULL DEFAULT NULL COMMENT '站点ID',
  `wx_rule_id` int(0) NULL DEFAULT NULL COMMENT '微信公众号支付规则ID',
  `card_rule_id` int(0) NULL DEFAULT NULL COMMENT '卡规则id',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '添加时间',
  `device_type` int(0) NOT NULL DEFAULT 2 COMMENT '设备类型 2:二轮车 4:四轮车',
  `pile_type` int(0) NOT NULL DEFAULT 0 COMMENT '充电桩类型 0:慢充 1:快充',
  `pile_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '设备状态  1:启用  0:禁用',
  `electricity` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '电流信息',
  `voltage` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '电压信息',
  `max_power` int(0) NULL DEFAULT NULL COMMENT '最大功率',
  `fee_need_update` tinyint(1) NOT NULL DEFAULT 0 COMMENT '费用需要更新，1:需要更新 0:不需要',
  `api_version` int(0) NULL DEFAULT 1 COMMENT '协议版本 1云快充 2唐总',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注信息',
  `deleted` tinyint(1) UNSIGNED ZEROFILL NULL DEFAULT 0 COMMENT '删除状态 0：未删除，1：删除',
  `is_hlht` int(0) NULL DEFAULT NULL COMMENT '是否来自互联互通',
  `hlht_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '互联互通编号',
  `tenant_id` bigint(0) NULL DEFAULT NULL COMMENT '租户编号',
  `create_by` varchar(24) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(24) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`pile_id`) USING BTREE,
  INDEX `idx_userid`(`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '充电桩表' ROW_FORMAT = Dynamic;

