DROP TABLE IF EXISTS `c_charging_port`;
CREATE TABLE `c_charging_port`  (
  `port_id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '端口编号',
  `user_id` bigint(0) NULL DEFAULT NULL COMMENT '用户ID',
  `state` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT 'N' COMMENT '插口状态 N是未使用 Y 在使用 F是故障',
  `power` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '0' COMMENT '电量',
  `name` varchar(700) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '端口名字编号',
  `pile_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电桩ID',
  `device_id` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '端口ID，用来和硬件交互也就是netty',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `gun_insert` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `gun_status` int(0) NULL DEFAULT NULL COMMENT '充电口状态0空闲1充电2预约3正在启动充电10启动失败05充电故障',
  `can_use` int(0) NULL DEFAULT NULL COMMENT '0可用1不可用',
  `fault_code` int(0) NULL DEFAULT NULL COMMENT '故障码',
  `fault_reason` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '故障原因',
  `fault_time` datetime(0) NULL DEFAULT NULL COMMENT '故障时间',
  `qr_code` varchar(4000) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '二维码',
  `is_hlht` int(0) NULL DEFAULT NULL,
  `hlht_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `tenant_id` bigint(0) NULL DEFAULT NULL COMMENT '租户编号',
  `create_by` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `update_time` datetime(0) NULL DEFAULT NULL,
  `update_by` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`port_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4541 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '充电桩端口表' ROW_FORMAT = Dynamic;

