-- Table structure for c_custom_price
-- ----------------------------
DROP TABLE IF EXISTS `c_custom_price`;
CREATE TABLE `c_custom_price`  (
  `price_id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `charge_type` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '3001' COMMENT '计费类型 3001：按小时计费 3002：按度数计费（此类型，一个充电桩就一个）',
