  `price` decimal(12, 4) NULL DEFAULT NULL COMMENT '费用，四轮车时是电费 元/度',
  `hours` decimal(12, 4) NULL DEFAULT NULL COMMENT '每小时-单价',
  `type` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '1.固定 2.自定义时长',
  `granternum` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '规则大于4个小时，第五个小时0.5元',
  `granterprice` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '规则大于4个小时，第五个小时0.5元',
  `pile_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电桩ID',
  `rule_id` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '规则ID',
  `del_flag` int(0) NULL DEFAULT 0 COMMENT '删除标记，默认0：未删除，1 删除',
  `service_price` decimal(12, 4) NULL DEFAULT NULL COMMENT '服务费用，元/度',
  `min_watt` int(0) NULL DEFAULT NULL COMMENT '最小瓦数',
  `max_watt` int(0) NULL DEFAULT NULL COMMENT '最大瓦数',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `price_type` int(0) NULL DEFAULT 0 COMMENT '电费类型(4轮车使用) 0:尖 1:峰 2:平 3:谷',
  `rang_time` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '时间范围,一个json字符串 [{\"startTime\":0.5,\"endTime\":1}]',
  `tenant_id` bigint(0) NULL DEFAULT NULL COMMENT '租户编号',
  `create_by` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`price_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2500 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '价格表' ROW_FORMAT = Dynamic;

