-- ----------------------------
DROP TABLE IF EXISTS `c_heartbeat`;
CREATE TABLE `c_heartbeat`  (
  `pile_id` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '充电桩ID',
  `device_id` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '充电桩端口',
