  PRIMARY KEY (`operator_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '运营商信息' ROW_FORMAT = Dynamic;

