-- ----------------------------
-- Table structure for hlht_station_info
-- ----------------------------
DROP TABLE IF EXISTS `hlht_station_info`;
CREATE TABLE `hlht_station_info`  (
  `station_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `station_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `station_unique_number` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '行政区划代码，区县地区码\r\n（6 位）+运营商 ID（9 位）\r\n+充换电站 ID。',
  `equipment_owner_id` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '基础设施运营商，场站属\r\n主的组织机构代码九位',
  `operator_id` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '运营商ID',
  `country_code` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '国家代码',
  `area_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '省市辖区的区县代码',
  `area_code_countryside` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '填写内容为12位行政区划代\r\n码，1- 6位为县及以上行政\r\n区划代码，7-12 位\r\n为县以下区划代码；参考地\r\n址',
  `address` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '充电站详细地址',
  `station_type` varchar(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '站点类型：\r\n1：公共\r\n50：个人\r\n100：公交（专用）\r\n101：环卫（专用）\r\n102：物流（专用）\r\n103： 出租车（专用）\r\n104：分时租赁（专用）\r\n105：小区共享（专用）\r\n106：单位（专用）\r\n107：私人共享设备（专\r\n用）\r\n255：其它',
  `station_status` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '0：未知\r\n1：建设中\r\n5：关闭下线\r\n6：维护中\r\n50：正常使用\r\n51：歇业',
  `station_lng` float(6, 3) NULL DEFAULT NULL COMMENT '站点经度',
  `station_lat` float(6, 3) NULL DEFAULT NULL COMMENT '站点维度',
  `station_tel` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '站点电话，能够联系场站工\r\n作人员进行协 助的电话',
  `park_num` int(0) NULL DEFAULT NULL COMMENT '⻋位数量，可停放充电的⻋\r\n位总数\r\n默认为0，表示未知',
  `service_tel` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '服务电话',
  `site_guide` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '站点指引，描述性文字，用\r\n于引导车主找 到充电车',
  `station_classification` int(0) NULL DEFAULT NULL COMMENT '1：充电站\r\n2：换电站\r\n3：充换电一体站',
  `general_application_type` int(0) NULL DEFAULT NULL COMMENT '1：通用（可为 3 种及 3 种\r\n以上的换电车型进行换电的\r\n换电站）\r\n2：非通用\r\n注：站点分类为 2 或 3 时，\r\n此字段为必填项；站点分类',
  `match_cars` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '服务车型描\r\n述',
  `park_type` int(0) NULL DEFAULT NULL COMMENT '0：免费\r\n1：不免费\r\n2：限时免费停车\r\n3：充电限时减免\r\n255：参考场地实际收费标\r\n准',
  `pictures` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '点照片：充电设备照片，\r\n充电车位照片，停车场入口\r\n照片',
  `park_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '车位楼层及数量信息',
  `busine_hours` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '营业时间描述',
  `electricity_fee` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '充电电费描述，24小时\r\n内可多段，每段大于等\r\n于15分钟，标准格式：',
  `swap_fee` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '固定格式文本',
  `service_fee` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '服务费',
  `park_fee` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '停车描述，24小时内可多段\r\n。rules : 车费规则描述',
  `round_the_clock` int(0) NULL DEFAULT NULL COMMENT '7*24小时\r\n营业',
  `payment` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式：刷卡、线上、\r\n现金。\r\n电子钱包类卡位刷卡，\r\n身份鉴权卡、微信/支付\r\n宝、APP为线上',
  `support_order` int(0) NULL DEFAULT NULL COMMENT '是否支持预约：\r\n0：不支持\r\n1：支持\r\n默认为0',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `position_num` int(0) NULL DEFAULT NULL COMMENT '仓位数量',
  `rated_capacity` int(0) NULL DEFAULT NULL COMMENT '整站配电容\r\n量',
  `channel_type` int(0) NULL DEFAULT NULL COMMENT '通道类型',
  `electricity_type` int(0) NULL DEFAULT NULL COMMENT '电费类型',
  `business_expand_type` int(0) NULL DEFAULT NULL COMMENT '报装类型',
  `capacity` double(6, 4) NULL DEFAULT NULL COMMENT '报装电源容\r\n量',
  `rated_power` double(8, 4) NULL DEFAULT NULL COMMENT '站点额定总\r\n功率',
  `period_fee` int(0) NULL DEFAULT NULL COMMENT '峰谷分时',
  `official_run_time` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '正式投运时\r\n间',
  `station_orientation` int(0) NULL DEFAULT NULL COMMENT '充换电站方\r\n位',
  `station_area` double(6, 4) NULL DEFAULT NULL COMMENT '充电场站建设用地面积',
  `have_person` int(0) NULL DEFAULT NULL COMMENT '充换电站人\r\n工值守',
  `video_monitor` int(0) NULL DEFAULT NULL COMMENT '视频监控配\r\n套情况',
  `supporting_facilities` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '周边配套设\r\n施',
  `printer_flag` int(0) NULL DEFAULT NULL COMMENT '是否有小票\r\n机',
  `barrier_flag` int(0) NULL DEFAULT NULL COMMENT '是否有道闸',
  `parking_lock_flag` int(0) NULL DEFAULT NULL COMMENT '是否有地锁',
  `change_type` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '换电计费类\r\n型',
  `expression` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '换电计算公\r\n式',
  `equipment_infos` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '充电设备列\r\n表',
  `build_time` varchar(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '建站时间',
  `last_update_time` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '最后后更新时间',
  `construction` int(0) NULL DEFAULT NULL COMMENT '建设场所',
  `plot_id` int(0) NULL DEFAULT NULL COMMENT '场所ID',
  `tenant_id` bigint(0) NULL DEFAULT NULL COMMENT '租户编号',
  PRIMARY KEY (`station_id`) USING BTREE,
  UNIQUE INDEX `station_id`(`station_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of hlht_station_info
-- ----------------------------

